import React, { useState, useEffect } from "react";
import items from './products.json';

const Shop = () => {
    const [cart, setCart] = useState([]); // State variable to store the cart items
    const [cartTotal, setCartTotal] = useState(0); // State variable to store the total price of the cart items

    // Function to calculate the total price of the items in the cart
    const total = () => {
        let totalVal = 0;
        for (let i = 0; i < cart.length; i++) {
            totalVal += cart[i].price * cart[i].quantity; // Multiply price by quantity
        }
        setCartTotal(totalVal);
    };

    // Update total whenever cart changes
    useEffect(() => {
        total();
    }, [cart]);

    // Function to add a product to the cart
    const addToCart = (el) => {
        const existingIndex = cart.findIndex((item) => item.id === el.id);
        if (existingIndex !== -1) {
            const updatedCart = [...cart];
            updatedCart[existingIndex].quantity += 1;
            setCart(updatedCart);
        } else {
            setCart([...cart, { ...el, quantity: 1 }]);
        }
    };

    // Function to remove a product from the cart
    const removeFromCart = (el) => {
        const updatedCart = cart.filter((item) => item.id !== el.id || item.quantity > 1);
        setCart(updatedCart);
    };

    // Mapping over the products to display them
    const listItems = items.map((el, index) => (
        <div className="row border-top border-bottom" key={index}>
            <div className="col">
                <div className="row main align-items-center">
                    <div className="col-2">
                        <img className="img-fluid bigger-image" src={el.image} alt={el.title} style={{ width: '150px', height: '150px' }} />
                        {/* Increase the width and height of the product image */}
                    </div>
                    <div className="col">
                        <div className="row text-muted">{el.title}</div>
                        <div className="row">{el.category}</div>
                    </div>
                    <div className="col">
                        <button type="button" variant="light" onClick={() => removeFromCart(el)}> - </button>{" "}
                        <button type="button" variant="light" onClick={() => addToCart(el)}> + </button>
                    </div>
                    <div className="col">
                        ${el.price} <span className="close">&#10005;</span>{cart.find((item) => item.id === el.id)?.quantity || 0}
                        {/* Display the quantity of the item in the cart */}
                    </div>
                </div>
            </div>
        </div>
    ));

    return (
        <div>
            STORE SE/ComS319
            <div className="card">
                <div className="row">
                    <div className="col-md-8 cart">
                        <div className="title">
                            <div className="row">
                                <div className="col">
                                    <h4>
                                        <b>Products</b>
                                    </h4>
                                </div>
                                <div className="col align-self-center text-right text-muted">
                                    Products selected {cart.reduce((acc, item) => acc + item.quantity, 0)}
                                    {/* Display total number of items in the cart */}
                                </div>
                                <div className="col">
                                    <span className="small text-muted" id="order">Order total:</span>
                                    <span className="lead fw-normal" id="order2">${cartTotal}</span>
                                </div>
                            </div>
                        </div>
                        <div>{listItems}</div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Shop;
